//import "./home.css"

function Carrer() {
    return (
      <div>
        <Navbar/>
        <h1>Carrer Highlights</h1>
        <img src={require("../media/ms-arva-intelligence-logo.png")} alt="123"/>
        
      </div>
    );
  }
  
  export default Carrer;
